import React, { useEffect } from "react";

const RealisticPizzaBurger = () => {
  useEffect(() => {
    // Draw Pizza - Enhanced Realism
    const pizzaCanvas = document.getElementById("pizzaCanvas");
    const pizzaCtx = pizzaCanvas.getContext("2d");

    // Pizza Base (Dough)
    pizzaCtx.fillStyle = "#e2b97f"; // Dough color
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 80, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pizza Crust (Thick golden crust)
    pizzaCtx.fillStyle = "#d68f3b";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 90, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Tomato Sauce
    pizzaCtx.fillStyle = "#d93d3d";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 75, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Cheese Layer
    pizzaCtx.fillStyle = "#f9d75c";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 70, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pepperoni slices (More depth and spread out)
    pizzaCtx.fillStyle = "#d24949"; // Pepperoni red
    pizzaCtx.beginPath();
    pizzaCtx.arc(50, 70, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(150, 70, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(80, 140, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 140, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 160, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(140, 160, 10, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Mushrooms (Realistic texture)
    pizzaCtx.fillStyle = "#a68f62"; // Mushrooms
    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 110, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 120, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Black Olives
    pizzaCtx.fillStyle = "#4d4d4d"; // Black Olives
    pizzaCtx.beginPath();
    pizzaCtx.arc(90, 80, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(110, 120, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Onions (Sliced thin)
    pizzaCtx.fillStyle = "#f5b82d"; // Onions
    pizzaCtx.beginPath();
    pizzaCtx.arc(70, 100, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Draw Burger - Realistic Layers and Details
    const burgerCanvas = document.getElementById("burgerCanvas");
    const burgerCtx = burgerCanvas.getContext("2d");

    // Bottom Bun (Golden, soft look)
    burgerCtx.fillStyle = "#f7c092"; // Bottom bun
    burgerCtx.beginPath();
    burgerCtx.arc(100, 160, 60, Math.PI, 0, true);
    burgerCtx.fill();

    // Patty (Beef Patty)
    burgerCtx.fillStyle = "#4c3c3c"; // Beef patty
    burgerCtx.beginPath();
    burgerCtx.arc(100, 130, 50, 0, Math.PI * 2);
    burgerCtx.fill();

    // Lettuce (Leafy green)
    burgerCtx.fillStyle = "#73b87b"; // Lettuce color
    burgerCtx.beginPath();
    burgerCtx.arc(100, 110, 55, Math.PI, 0, true);
    burgerCtx.fill();

    // Tomato Slice (Bright red)
    burgerCtx.fillStyle = "#e94e77"; // Tomato red
    burgerCtx.beginPath();
    burgerCtx.arc(100, 90, 40, Math.PI, 0, true);
    burgerCtx.fill();

    // Cheese Slice (Melted cheese)
    burgerCtx.fillStyle = "#f9e16b"; // Cheese color
    burgerCtx.fillRect(50, 75, 100, 10); // A slice of cheese

    // Onion Rings (Visible slices)
    burgerCtx.fillStyle = "#f1c1a0"; // Onion rings
    burgerCtx.beginPath();
    burgerCtx.arc(70, 75, 5, 0, Math.PI * 2);
    burgerCtx.arc(130, 75, 5, 0, Math.PI * 2);
    burgerCtx.fill();

    // Top Bun (Matching golden color)
    burgerCtx.fillStyle = "#f7c092"; // Top bun
    burgerCtx.beginPath();
    burgerCtx.arc(100, 60, 60, 0, Math.PI * 2);
    burgerCtx.fill();

    // Sesame Seeds on Top Bun
    burgerCtx.fillStyle = "#e1b97a"; // Sesame seeds
    burgerCtx.beginPath();
    burgerCtx.arc(70, 45, 4, 0, Math.PI * 2);
    burgerCtx.arc(100, 40, 4, 0, Math.PI * 2);
    burgerCtx.arc(130, 45, 4, 0, Math.PI * 2);
    burgerCtx.fill();
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Realistic Pizza & Burger</h2>
      <div style={styles.canvasContainer}>
        <canvas id="pizzaCanvas" width="200" height="200" style={styles.canvas}></canvas>
        <canvas id="burgerCanvas" width="200" height="200" style={styles.canvas}></canvas>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #ffe5d9, #fbd9e1)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "500px",
    margin: "auto",
  },
  heading: {
    color: "#f04e8c",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
    fontSize: "24px",
  },
  canvasContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
  },
  canvas: {
    border: "3px solid #f04e8c",
    borderRadius: "10px",
    backgroundColor: "#ffffff",
  },
};

export default RealisticPizzaBurger;
